import { useState } from 'react';
import axios from 'axios';
import Product from '../components/product';

const getData = async () => {
  const {headers, data} = await axios.get('http://0.0.0.0:8080/products/?_page=1');
  console.log(data, '\n', 'total:', headers['x-total-count']);
}

const Home = () => {
  getData();
  return (
    <div>
      Hi
      <Product />
    </div>
  );
};

export default Home;
